# UNO No Mercy - PowerShell GUI Game with Windows 11 Styling

# Suppress All Console Output
$ErrorActionPreference = 'SilentlyContinue'
$WarningPreference = 'SilentlyContinue'
$InformationPreference = 'SilentlyContinue'
$VerbosePreference = 'SilentlyContinue'
$DebugPreference = 'SilentlyContinue'

function Write-Host   {}
function Write-Output {}
function Write-Warning {}
function Write-Error  {}
function Write-Verbose {}
function Write-Debug  {}
function Write-Information {}

Add-Type -AssemblyName System.Windows.Forms
Add-Type -AssemblyName System.Drawing

function Point($x, $y) { New-Object System.Drawing.Point -ArgumentList $x, $y }
function Size($w, $h) { New-Object System.Drawing.Size -ArgumentList $w, $h }

$global:GameCancelled = $false
$global:TempFilePath = Join-Path $env:TEMP "UNO_NoMercy_Scores.csv"
$global:LeaderboardLabels = @()
$global:InputBoxes = @()
$global:RoundCounter = 0

$null = Register-EngineEvent PowerShell.Exiting -Action {
    if (Test-Path $global:TempFilePath) {
        Remove-Item $global:TempFilePath -ErrorAction SilentlyContinue
    }
}

function Select-All-On-Focus ($control) {
    if ($control -is [System.Windows.Forms.TextBox]) {
        $control.Add_Enter({ $this.SelectAll() })
        $control.Add_MouseClick({ $this.SelectAll() })
    } elseif ($control -is [System.Windows.Forms.NumericUpDown]) {
        $control.Controls | ForEach-Object {
            if ($_ -is [System.Windows.Forms.TextBox]) {
                $_.Add_Enter({ $this.SelectAll() })
                $_.Add_MouseClick({ $this.SelectAll() })
            }
        }
    }
}

function Add-CloseButton($form) {
    $btnClose = New-Object System.Windows.Forms.Button
    $btnClose.Text = "Close"
    $btnClose.Size = Size 80 30
    $btnClose.Location = Point ($form.ClientSize.Width - 90) ($form.ClientSize.Height - 40)
    $btnClose.Anchor = "Bottom,Right"
    $btnClose.FlatStyle = 'Flat'
    $btnClose.BackColor = [System.Drawing.Color]::FromArgb(225, 225, 225)
    $btnClose.ForeColor = [System.Drawing.Color]::Black
    $btnClose.Add_Click({
        $global:GameCancelled = $true
        $form.Close()
    })
    $form.Controls.Add($btnClose)
    $form.ControlBox = $false
}

function Set-FormBackground($form, $base64Image) {
    $bytes = [Convert]::FromBase64String($base64Image)
    $ms = New-Object System.IO.MemoryStream(,$bytes)
    $image = [System.Drawing.Image]::FromStream($ms)

    $bmp = New-Object System.Drawing.Bitmap $form.Width, $form.Height
    $g = [System.Drawing.Graphics]::FromImage($bmp)

    $colorMatrix = New-Object System.Drawing.Imaging.ColorMatrix
    $colorMatrix.Matrix33 = 0.1  # 10% opacity (washed out)

    $imageAttributes = New-Object System.Drawing.Imaging.ImageAttributes
    $imageAttributes.SetColorMatrix($colorMatrix, [System.Drawing.Imaging.ColorMatrixFlag]::Default, [System.Drawing.Imaging.ColorAdjustType]::Bitmap)

    $rect = New-Object System.Drawing.Rectangle 0, 0, $form.Width, $form.Height
    $g.DrawImage($image, $rect, 0, 0, $image.Width, $image.Height, "Pixel", $imageAttributes)

    $form.BackgroundImage = $bmp
    $form.BackgroundImageLayout = "Stretch"
}

function Start-UNONoMercyGame {
    $form = New-Object System.Windows.Forms.Form
    $form.Text = "UNO No Mercy - Setup"
    $form.Size = Size 380 220
    $form.StartPosition = "CenterScreen"
    $form.ControlBox = $false

    $labelPlayers = New-Object System.Windows.Forms.Label
    $labelPlayers.Text = "Number of Players:"
    $labelPlayers.Location = Point 10 20
    $labelPlayers.Size = Size 130 20
    $labelPlayers.BackColor = 'Transparent'
    $form.Controls.Add($labelPlayers)

    $inputPlayers = New-Object System.Windows.Forms.NumericUpDown
    $inputPlayers.Location = Point 160 18
    $inputPlayers.Minimum = 2
    $inputPlayers.Maximum = 10
    Select-All-On-Focus $inputPlayers
    $form.Controls.Add($inputPlayers)

    $labelLimit = New-Object System.Windows.Forms.Label
    $labelLimit.Text = "Game Point Limit:"
    $labelLimit.Location = Point 10 60
    $labelLimit.Size = Size 130 20
    $labelLimit.BackColor = 'Transparent'
    $form.Controls.Add($labelLimit)

    $inputLimit = New-Object System.Windows.Forms.NumericUpDown
    $inputLimit.Location = Point 160 58
    $inputLimit.Minimum = 100
    $inputLimit.Maximum = 2000
    $inputLimit.Increment = 50
    Select-All-On-Focus $inputLimit
    $form.Controls.Add($inputLimit)

    $btnStart = New-Object System.Windows.Forms.Button
    $btnStart.Text = "Next"
    $btnStart.Size = Size 100 30
    $btnStart.Location = Point 130 100
    $btnStart.FlatStyle = 'Flat'
    $btnStart.BackColor = [System.Drawing.Color]::FromArgb(0,120,215)
    $btnStart.ForeColor = [System.Drawing.Color]::White
    $form.Controls.Add($btnStart)
    $form.AcceptButton = $btnStart

    $btnStart.Add_Click({
        $global:PlayerCount = [int]$inputPlayers.Value
        $global:GameLimit = [int]$inputLimit.Value
        $form.Close()
    })

    Add-CloseButton $form
    $null = $form.ShowDialog()
}

function Get-PlayerNames {
    $form = New-Object System.Windows.Forms.Form
    $form.Text = "Enter Player Names"
    $form.Size = Size 400 (($PlayerCount * 40) + 100)
    $form.StartPosition = "CenterScreen"
    Add-CloseButton $form

    $global:PlayerNames = @()
    $textBoxes = @()

    for ($i = 0; $i -lt $PlayerCount; $i++) {
        $label = New-Object System.Windows.Forms.Label
        $label.Text = "Player $($i+1):"
        $label.Location = Point 10 (($i * 30) + 20)
        $label.BackColor = 'Transparent'
        $form.Controls.Add($label)

        $textBox = New-Object System.Windows.Forms.TextBox
        $textBox.Location = Point 120 (($i * 30) + 18)
        $textBox.Width = 200
        Select-All-On-Focus $textBox
        $form.Controls.Add($textBox)
        $textBoxes += $textBox
    }

    $btnSubmit = New-Object System.Windows.Forms.Button
    $btnSubmit.Text = "Start Game"
    $btnSubmit.Location = Point 130 (($PlayerCount * 30) + 30)
    $btnSubmit.Size = Size 100 30
    $btnSubmit.FlatStyle = 'Flat'
    $btnSubmit.BackColor = [System.Drawing.Color]::FromArgb(0,120,215)
    $btnSubmit.ForeColor = [System.Drawing.Color]::White
    $btnSubmit.Add_Click({
        $global:PlayerNames = $textBoxes | ForEach-Object { $_.Text }
        if ($PlayerNames -contains "") {
            [System.Windows.Forms.MessageBox]::Show("Please enter all names.")
        } else {
            $form.Close()
        }
    })
    $form.Controls.Add($btnSubmit)
    $form.AcceptButton = $btnSubmit
    $null = $form.ShowDialog()
}

function Create-GameForm {
    $form = New-Object System.Windows.Forms.Form
    $form.Text = "UNO No Mercy - Game"
    $form.Size = Size 1000 (($PlayerCount * 35) + 220)
    $form.StartPosition = "CenterScreen"
    $form.MaximizeBox = $true
    Set-FormBackground $form $base64Image
    Add-CloseButton $form

    $labelTitle = New-Object System.Windows.Forms.Label
    $labelTitle.Text = "Current Scores"
    $labelTitle.Font = New-Object System.Drawing.Font("Segoe UI", 11, [System.Drawing.FontStyle]::Bold)
    $labelTitle.Location = Point 10 10
    $labelTitle.AutoSize = $true
    $labelTitle.BackColor = 'Transparent'
    $form.Controls.Add($labelTitle)

    $global:LeaderboardLabels.Clear()
    $scoreFont = New-Object System.Drawing.Font("Segoe UI", 15, [System.Drawing.FontStyle]::Bold)
    $startX = 20
    $gap = [math]::Floor(($form.ClientSize.Width - 40) / $PlayerCount)

    for ($i = 0; $i -lt $PlayerCount; $i++) {
        $lbl = New-Object System.Windows.Forms.Label
        $lbl.Text = ""
        $lbl.Location = Point ($startX + ($gap * $i)) 40
        $lbl.AutoSize = $true
        $lbl.Font = $scoreFont
        $lbl.BackColor = 'Transparent'
        $form.Controls.Add($lbl)
        $global:LeaderboardLabels += $lbl
    }

    $divider = New-Object System.Windows.Forms.Label
    $divider.BorderStyle = 'Fixed3D'
    $divider.Location = Point 10 70
    $divider.Size = Size ($form.ClientSize.Width - 20) 2
    $form.Controls.Add($divider)

    $global:InputBoxes.Clear()
    for ($i = 0; $i -lt $PlayerCount; $i++) {
        $lbl = New-Object System.Windows.Forms.Label
        $lbl.Text = "$($PlayerNames[$i]) Round:"
        $lbl.Location = Point 10 (85 + ($i * 30))
        $lbl.BackColor = 'Transparent'
        $form.Controls.Add($lbl)

        $num = New-Object System.Windows.Forms.NumericUpDown
        $num.Location = Point 160 (83 + ($i * 30))
        $num.Maximum = 1000
        Select-All-On-Focus $num
        $form.Controls.Add($num)
        $global:InputBoxes += $num
    }

    $btnSubmit = New-Object System.Windows.Forms.Button
    $btnSubmit.Text = "Submit Round"
    $btnSubmit.Location = Point 150 (100 + ($PlayerCount * 30))
    $btnSubmit.Size = Size 130 30
    $btnSubmit.FlatStyle = 'Flat'
    $btnSubmit.BackColor = [System.Drawing.Color]::FromArgb(0,120,215)
    $btnSubmit.ForeColor = [System.Drawing.Color]::White
    $btnSubmit.Add_Click({
        for ($i = 0; $i -lt $PlayerCount; $i++) {
            $Scores[$i] += [int]$global:InputBoxes[$i].Value
            $global:InputBoxes[$i].Value = 0
        }
        Save-ToCSV
        Update-Leaderboard
        if ($Scores | Where-Object { $_ -ge $GameLimit }) {
            $form.Close()
            Show-Results
        }
    })
    $form.AcceptButton = $btnSubmit
    $form.Controls.Add($btnSubmit)

    Update-Leaderboard
    $null = $form.ShowDialog()
}

function Update-Leaderboard {
    $isFirstRound = ($global:RoundCounter -eq 0)

    $ranked = @()
    for ($i = 0; $i -lt $PlayerCount; $i++) {
        $ranked += [PSCustomObject]@{ Index = $i; Name = $PlayerNames[$i]; Score = $Scores[$i] }
    }

    $ranked = $ranked | Sort-Object Score

    for ($i = 0; $i -lt $PlayerCount; $i++) {
        if ($isFirstRound) {
            $global:LeaderboardLabels[$i].Text = "$($PlayerNames[$i]): $($Scores[$i]) pts"
        } else {
            $rank = ($ranked | Where-Object { $_.Index -eq $i }) | ForEach-Object {
                ($ranked.IndexOf($_) + 1)
            }

            $suffix = switch ($rank) {
                1 { "1st" }
                2 { "2nd" }
                3 { "3rd" }
				4 { "4th" }
				5 { "5th" }
                default { "$rank th" }
            }

            $global:LeaderboardLabels[$i].Text = "$($PlayerNames[$i]): $($Scores[$i]) pts ($suffix)"
        }
    }

    $global:RoundCounter++

    if ($global:InputBoxes.Count -gt 0) {
        $global:InputBoxes[0].Focus()
        $global:InputBoxes[0].Select(0, $global:InputBoxes[0].Text.Length)
    }
}

function Save-ToCSV {
    $data = for ($i = 0; $i -lt $PlayerCount; $i++) {
        [PSCustomObject]@{ Player = $PlayerNames[$i]; Score = $Scores[$i] }
    }
    $data | Export-Csv -Path $global:TempFilePath -NoTypeInformation -Force
}

function Show-Results {
    $sorted = @()
    for ($i = 0; $i -lt $PlayerCount; $i++) {
        $sorted += [PSCustomObject]@{ Name = $PlayerNames[$i]; Score = $Scores[$i] }
    }
    $sorted = $sorted | Sort-Object Score

    $form = New-Object System.Windows.Forms.Form
    $form.Text = "Final Rankings"
    $form.Size = Size 400 (($PlayerCount * 30) + 100)
    $form.StartPosition = "CenterScreen"
    Add-CloseButton $form

    $lblTitle = New-Object System.Windows.Forms.Label
    $lblTitle.Text = "Final Rankings"
    $lblTitle.Font = New-Object System.Drawing.Font("Segoe UI", 12, [System.Drawing.FontStyle]::Bold)
    $lblTitle.AutoSize = $true
    $lblTitle.Location = Point 10 10
    $lblTitle.BackColor = 'Transparent'
    $form.Controls.Add($lblTitle)

    for ($i = 0; $i -lt $sorted.Count; $i++) {
        $lbl = New-Object System.Windows.Forms.Label
        $lbl.AutoSize = $true
        $lbl.Location = Point 20 (40 + ($i * 25))
        $lbl.BackColor = 'Transparent'

        if ($i -eq 0) {
            $lbl.Font = New-Object System.Drawing.Font("Segoe UI", 10, 'Bold')
            $lbl.Text = "Winner: $($sorted[$i].Name) - $($sorted[$i].Score) pts"
        } elseif ($i -eq $sorted.Count - 1) {
            $lbl.Font = New-Object System.Drawing.Font("Segoe UI", 10, 'Bold')
            $lbl.Text = "Looser: $($sorted[$i].Name) - $($sorted[$i].Score) pts"
        } else {
            $lbl.Font = New-Object System.Drawing.Font("Segoe UI", 9)
            $lbl.Text = "$($i+1). $($sorted[$i].Name) - $($sorted[$i].Score) pts"
        }
        $form.Controls.Add($lbl)
    }

    $null = $form.ShowDialog()
}

